import React from 'react';
import './Contact.css';
import PropType from 'prop-types'

const name = 'T-800';
const online = true;


function Contact(props){
    return(
        <div className="Contact">

            <div>
                <img className="avatar" src={props.avatar} alt={props.nickname + "avatar"}/>
            </div>
            <div className="status">
                <p className="name">{props.nickname}</p>
                <div className="status">
                    {online ? <div className="status-online"> <p >{props.online}</p></div> 
                    :
                    <div className="status-offline"> <p>{props.offline}</p></div>}
                </div>
            </div>


        </div>
    )
}

Contact.prototype = {
    nickname : PropType.string.isRequired,
    avatar : PropType.string.isRequired,
    online : PropType.bool.isRequired
}
export default Contact;
